INSERT INTO `product` VALUES (17,'D-120CE NT','The Harley Benton D-120CE NT is a typical steel-string guitar with a robust dovetail construction, which also allows solo playing with its cutaway. Not only are the neck and headstock of this dreadnought guitar made of mahogany, its back and sides are made of mahogany as well.','/uploads/1746079453647.jpg',85,'{\"Number of strings\":\"6\",\"Body Shape\":\"Dreadnought\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Rosewood\"}',75,1,21),(18,'Hummingbird Standard','Made in USA','/uploads/1746079994831.png',3333,'{\"Number of strings\":\"6\",\"Body Shape\":\"Dreadnought\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Rosewood\"}',65,1,21),(19,'J-200 EC Studio BK','Nut width: 4.27 cm\r\nGold-plated hardware\r\nColour: Black','/uploads/1746080376548.png',469,'{\"Number of strings\":\"6\",\"Body Shape\":\"Jumbo\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Rosewood\"}',76,1,21),(20,'552ce 12-Fret Urban Ironbark','Style: Grand Concert with cutaway, Back and sides: solid Urban Ironbark, Nut width: 47.6 mm, Colour: Natural Shaded Edgeburst, Made in USA','/uploads/1746082774126.png',2190,'{\"Number of strings\":\"12\",\"Body Shape\":\"Dreadnought\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Rosewood\"}',68,1,21),(21,'C40','Bridge: Rosewood (Dalbergia latifolia), \r\nNut width: 52 mm, \r\nBody depth: 43 - 100 mm, \r\nScale: 650 mm (25.59\"), \r\nColour: Natural High-gloss','/uploads/1746082985929.png',111,'{\"Fretboard Material\":\"Rosewood\"}',63,1,22),(22,'Academy Series 12e-N','Top: Lutz spruce, solid, \r\nNut width: 47.6 mm, \r\nColour: Natural, \r\nIncludes Taylor gigbag, \r\nMade in Mexico','/uploads/1746083127249.png',733,'{\"Fretboard Material\":\"Rosewood\"}',68,1,22),(23,'Player II Tele RW SPKL3TS','6-Saddle tele bridge with strings-thru-body and block saddles, \r\nFender ClassicGear machine heads, \r\nNickel/chrome hardware, \r\nStrings: Fender USA 250L Nickel Plated Steel .009-.042, \r\nColour: Sparkle 3-Colour Sunburst','/uploads/1746083796490.png',825,'{\"Number of strings\":\"6\",\"Body Shape\":\"Telecaster\",\"Pickup Configuration\":\"SSS\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Ebony\"}',67,1,23),(24,'LTD TE-200 SW','Pickups: ESP-designed LH-150N (neck) and ESP-designed LH-150B (bridge) humbuckers, \r\n1 x Volume control and 1 x tone control (Push-Pull), \r\n3-Way toggle switch, \r\nLTD fixed bridge with string-thru design','/uploads/1746085005965.png',499,'{\"Number of strings\":\"6\",\"Body Shape\":\"Telecaster\",\"Pickup Configuration\":\"SSS\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Ebony\"}',69,1,23),(25,'V5 Alder-4 TS','Nut width: 38 mm, \r\nBone nut, \r\nPickup: 2x Marcus Vintage-J Revolution Jazz Single Coils, \r\n2 Volume and 1 Tone control, \r\nVintage bridge','/uploads/1746085276465.png',419,'{\"Number of strings\":\"6\",\"Body Shape\":\"Telecaster\",\"Pickup Configuration\":\"SSS\",\"Top Material\":\"Spruce\",\"Fretboard Material\":\"Ebony\"}',77,1,24),(27,'P8-5 TS','Pickups: Marcus Super P Revolution Split Coil (neck) and Marcus Super J Revolution Single Coil (bridge), \r\nMarcus Heritage-3 Preamplifier with Mid Frequency Control, \r\nControls: Volume/Tone (Dual Pot), Pickup Blender, Treble, Middle/Middle Frequency (Dual Pot) and Bass, ','/uploads/1746091513573.png',825,'{\"Number of strings\":\"5\",\"Fretboard Material\":\"Maple\",\"Top Material\":\"Maple\",\"Body Shape\":\"Strat\"}',77,1,24),(28,'DP-95 B','500 Sounds, \r\n200 Styles, \r\n60 Internal songs, \r\n2 Demo songs, \r\nLCD, \r\n128 Voice polyphony, ','/uploads/1746093114064.png',549,'{\"Number of Keys\":\"88\"}',78,1,17),(29,'NP-15 Piaggero Black','15 Sounds, \r\n64 Voices polyphony, \r\nDual / Layer function, \r\nReverb, \r\n15 Voice Demo Songs, \r\n10 Piano Preset Songs, \r\nMetronome, \r\nTransposer, \r\nRecording function','/uploads/1746093283954.png',175,'{\"Number of Keys\":\"61\"}',63,1,17),(30,'P-145 B','Tone generator: Yamaha CFIIIS with damper resonance, \r\n64-voice polyphony, \r\n10 instrument presets, \r\n50 internal song presets + 303 additional songs to learn via the Smart Pianist app, \r\nDual / Duo modes','/uploads/1746093409345.png',379,'{\"Power Source\":\"Adapter\",\"Number of Keys\":\"88\"}',63,1,19),(31,'DP-26','20 Sounds, \r\n2 Demo songs, \r\n50 Styles, \r\n128 Voice polyphony, \r\nLED display, \r\nLayer mode, \r\nSplit mode, \r\nDuo mode, \r\nMaster EQ','/uploads/1746093524774.png',315,'{\"Number of Keys\":\"88\",\"Power Source\":\"Battery\",\"Touch Sensitivity\":true}',78,1,19),(32,'MODX7+','Velocity-sensitive semi-weighted keyboard, \r\nMotion control synthesis, \r\nSample-based AWM2 synthesis with 128 voices, \r\n5.67 GB waveform ROM & 1.75 GB flash ROM for user waveforms, \r\nFM-X synthesis with 128 voices','/uploads/1746093694073.png',1.529,'{\"Number of Keys\":\"76\",\"Power Source\":\"Adapter\"}',63,1,18),(33,'Launchkey 49 MK4','Buttons for octave up/down, arp/scale/fixed chord, play/stop/record/loop, track navigation, stop/solo/mute, capture MIDI/quantisation/click/undo, scene start as well as device selection and device lock functions, \r\nSplit and Layer function, \r\nDimensions (W x H x D): 730 x 93 x 263.5 mm','/uploads/1746093828261.png',248,'{\"Number of Keys\":\"49\",\"Touch Sensitivity\":true,\"Power Source\":\"Battery\"}',79,1,20),(37,'49SL MKIII','Dimensions: 816.6 x 299.6 x 100 mm, Weight: 5.36 kg, Includes power supply (12V DC), USB cable, Ableton Live Lite, 4 GB Loopmasters Sounds, XLN Audio Addictive Keys','http://localhost:5000/uploads/1768849178187.png',495,'{\"14\":49,\"15\":true,\"18\":\"Adapter\"}',79,1,20);
